import './App.css';
import Link from './Components/Link';
import ApplicantLogin from './Components/ApplicantLogin';
import Route from './Components/Route';

function App() {
  return (
    <div className="">
      <header className="App-header">
        <h1>Interview Hub</h1>
      </header>
      <Link to={"/confirmExam"}>EXAM</Link>
      <Link to={"/applicantLogin"}>LOGIN</Link>

      <Route path={"/applicantLogin"}><ApplicantLogin/></Route>
      <Route path={"/confirmExam"}><h1>confirm exam</h1></Route>
    </div> 
  );
}

export default App;
